
export const addDirectoryModuleElement = (parentElement) => {
  const newDiv = document.createElement("div");
  const newContent = document.createTextNode("Text inside directoryModule.js");
  newDiv.appendChild(newContent);

  document.body.insertBefore(newDiv, parentElement);
}

export const logDirectoryModule = () => {
  console.log("Directory Module alive!")
}